import './App.css';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Navigate to="/lists" />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
